(14, 'reasons foru800 disputes with service providers', ' there areu800 many reasons foru800 disputes with service providers during theu800 construction process ofu800 au800 house. theu800 following areu800 theu800 most common factors that lead tou800 these disputes. &nbsp; uncertainty uncertainty occurs when there isu800 au800 difference between theu800 amount ofu800 information required tou800 work andu800 theu800 amount ofu800 information available. theu800 amount ofu800 information required depends onu800 theu800 task complexity andu800 theu800 performance requirements usually measured inu800 time oru800 tou800 au800 budget. theu800 amount ofu800 information available depends onu800 theu800 effectiveness ofu800 planning andu800 requires theu800 collection andu800 interpretation ofu800 that information foru800 theu800 task. uncertainty means that notu800 every detail ofu800 au800 project canu800 beu800 planned before work begins. when uncertainty isu800 high initial drawings andu800 specification will almost certainly change andu800 theu800 project members will have tou800 work hard tou800 solve problems asu800 work proceeds ifu800 disputes areu800 tou800 beu800 avoided. &nbsp; behavioural issues &nbsp; since contracts cannot cater foru800 every eventuality wherever problems arise either party mayu800 have anu800 interest inu800 gaining asu800 much asu800 they canu800 from theu800 other. equally theu800 parties mayu800 have au800 different perception ofu800 theu800 facts. atu800 least oneu800 ofu800 theu800 parties mayu800 have unrealistic expectations affecting their ability tou800 reach agreement. alternatively oneu800 party mayu800 simply deny responsibility inu800 anu800 attempt tou800 avoid liability. these issues canu800 beu800 minimized byu800 selecting theu800 most suitable service provider foru800 your considering their history andu800 theu800 feedback. &nbsp; contractual problems &nbsp; standard forms ofu800 contract clearly prescribe theu800 risks andu800 obligations each party hasu800 agreed tou800 take. such rigid agreements mayu800 notu800 beu800 appropriate foru800 long-term transactions carried outu800 under conditions ofu800 uncertainty. itu800 isu800 notu800 uncommon tou800 find amended terms oru800 bespoke contracts that shift theu800 risk andu800 obligations ofu800 theu800 parties often tou800 theu800 party least capable ofu800 carrying that risk. where amended terms oru800 bespoke contracts areu800 used they mayu800 beu800 unclear andu800 ambiguous. asu800 au800 consequence differences mayu800 arise inu800 theu800 parties&rsquo; perception ofu800 theu800 risk allocation under theu800 contract. &nbsp; accelerating theu800 construction midway &nbsp; theu800 owner mayu800 want tou800 accelerate theu800 construction because ofu800 anu800 unavoidable condition butu800 chances areu800 that this could lead tou800 disputes. theu800 circumstances surrounding acceleration areu800 often notu800 properly analysed atu800 theu800 time theu800 decision isu800 made andu800 that inevitably leads tou800 disputes once theu800 service provider hasu800 carried outu800 accelerative measures andu800 incurred additional costs only tou800 find that theu800 owner refuses tou800 payu800. &nbsp; quality issues ofu800 theu800 work completed &nbsp; disputes mayu800 arise asu800 tou800 whether oru800 notu800 theu800 completed work isu800 inu800 accordance with theu800 specifications. theu800 specification mayu800 beu800 vague onu800 theu800 subject ofu800 theu800 dispute inu800 question andu800 each party tou800 theu800 contract mayu800 have au800 different view onu800 whether theu800 quality andu800 workmanship isu800 acceptable. this leads tou800 claims byu800 theu800 service provider foru800 additional costs which ifu800 notu800 resolved canu800 lead inu800 turn tou800 costly disputes. &nbsp; delays &nbsp; disputes frequently arise inu800 respect ofu800 delays andu800 whou800 should bear theu800 responsibility foru800 them. most construction contracts make provision foru800 extending theu800 time foru800 completion. theu800 reason foru800 this isu800 that theu800 owner canu800 keep alive anyu800 rights tou800 delay damages recoverable from theu800 service provider. from theu800 owner&rsquo;su800 point ofu800 view this made theu800 examination ofu800 theu800 true causes ofu800 delay problematical andu800 inevitably ledu800 tou800 disputes between theu800 service provider andu800 theu800 owner asu800 tou800 theu800 service provider&rsquo;su800 proper entitlement. '),
(15, 'hiring au800 service provider', ' &nbsp; theu800 factors that youu800 need tou800 consider when selecting au800 service provider foru800 theu800 tasks. 1u800. competence- theu800 competence ofu800 au800 service provider will beu800 theu800 basic requirement foru800 anyu800 type ofu800 service provider. some ofu800 theu800 service providers should beu800 qualified such asu800 au800 qualified architect. theu800 technical expertise ofu800 some service providers such asu800 electricians areu800 critical when building theu800 house. 2u800. experience- itu800 isu800 better tou800 select au800 more experienced service provider. 3u800. past work- ifu800 au800 service provider hasu800 worked inu800 your area previously heu800 will know more regarding theu800 conditions ofu800 theu800 area such asu800 geography weather etcu800. therefore selecting au800 service provider whou800 knows about your area would beu800 helpful. 4u800. opinions given byu800 hisu800 customers- this mayu800 beu800 theu800 best source ofu800 selecting au800 service provider. atu800 present normally theu800 customers rely onu800 au800 word-ofu800-mouth recommendation ofu800 some oneu800 tou800 select au800 service provider. ifu800 theu800 recommender makes anu800 error ofu800 judgement andu800 ifu800 theu800 customer does notu800 getu800 another opinion ofu800 au800 different person heu800 will getu800 mislead. youu800 will realise theu800 importance ofu800 baasu82elku800 considering this because inu800 here more customers could post comments andu800 make reviews sou800 itu800 isu800 easier tou800 understand whou800 isu800 theu800 best service provider foru800 your purpose. &nbsp; &nbsp; '),
(16, 'types ofu800 paints', ' interior paints &ndash; when selecting theu800 interior paints selecting theu800 most suitable colour isu800 very important. theu800 space lightning mood andu800 energy inu800 theu800 room should determine theu800 colour ofu800 theu800 interior wall paints. matching floor andu800 furniture will give anu800 attractive finish tou800 theu800 room. theu800 paint companies inu800 sriu800 lanka offer au800 wide range schemes andu800 facilitate colour mixing tou800 help youu800 select theu800 best colour. &nbsp; exterior paints &ndash; when selecting exterior paints notu800 only theu800 colour combinations butu800 also theu800 quality ofu800 theu800 paint isu800 also important tou800 make sure itu800 will last longer resisting both rain andu800 heat. theu800 paint should beu800 suitable tou800 theu800 tropical weather inu800 sriu800 lanka. &nbsp; &nbsp; floor paints &ndash; floor paints areu800 needed foru800 cement floors especially inu800 garage floors andu800 au800 quality paint would ensure that itu800 will last longer people wonu800&rsquo;tu800 slip. &nbsp; wood care paints &ndash; these paint will help youu800 tou800 protect theu800 windows doors furniture stair cases andu800 other wooden items ofu800 your house. market contains paint foru800 both gloss andu800 matt finishes. &nbsp; primers - this isu800 notu800 usually considered paint butu800 itu800 isu800 needed inu800 many painting projects andu800 especially foru800 surface preparation foru800 theu800 first paint coat. primer canu800 beu800 either oilu800 oru800 water-based sou800 when youu800 areu800 painting youu800 will want tou800 useu800 oneu800 that matches theu800 type ofu800 paint youu800 areu800 using. foru800 example ifu800 youu800&rsquo;reu800 painting with oilu800-based paint useu800 oilu800-based primer. there areu800 acrylic wall fillers under most brands inu800 theu800 sriu800 lankan market. '),
(17, 'types ofu800 cement', ' initially there wasu800 only oneu800 cement foru800 allu800 purposes. with time however itu800 wasu800 realized that au800 general-purpose cement isu800 notu800 adequate andu800 different cements were required foru800 different applications. theu800 rapid advancement ofu800 cement technology facilitated theu800 development ofu800 such special application cements. inu800 theu800 meantime newu800 cement standards hadu800 tou800 beu800 developed foru800 newu800 cements. aligning with theu800 global developments sriu800 lanka standards institution slsi revised twou800 available slsu800 standards namely sls107 foru800 ordinary portland cement opcu800 andu800 sls515 foru800 masonry cement inu800 2002 andu800 2003 respectively. then with theu800 european union&rsquo;su800 introduction ofu800 en197-1u800 2000 foru800 theu800 newu800 category ofu800 cement called &quot;common cements&quot; inu800 2000 theu800 slsi considered itu800 opportune tou800 develop newu800 sriu800 lankan standards aligning with this latest international standard. consequently slsi introduced inu800 2003 twou800 slsu800 standards foru800 twou800 categories ofu800 &quot;common cements&quot; sls1247 2003 foru800 blended hydraulic cements sls1253 2003 foru800 portland limestone cement both these cements - also called &quot;composite cements&quot; - areu800 highly recommended foru800 concrete applications although they canu800 also beu800 used asu800 general-purpose cements. when used foru800 concrete these cements improve both fresh state properties such asu800 workability andu800 hardened state properties such asu800 long-term strength andu800 durability. sls1247 2003 foru800 blended hydraulic cements hydraulic cements au800 blended hydraulic cement isu800 au800 blend ofu800 ordinary portland cement opcu800 andu800 pozzolanic material such asu800 flyu800 ashu800 blast furnace slag. itu800 isu800 manufactured either byu800 intergrinding portland cement clinker pozzolanic material slag andu800 gypsum oru800 byu800 blending pozzolanic material slag with ordinary portland cement. this cement isu800 ofu800 twou800 types depending onu800 theu800 main constituent used foru800 blending with portland cement oru800 portland cement clinker. theu800 main constituents ofu800 type iu800 portland pozzolanic cement areu800 clinker 65u800 tou800 94u800 byu800 mass andu800 pozzolanic material 6u800 tou800 35u800 . theu800 pozzolanic materials allowed byu800 theu800 standard areu800 natural pozzolana paddy husk ashu800 flyu800 ashu800 andu800 burnt shale. theu800 main constituents ofu800 type llu800 portland slag cement areu800 clinker 65u800 tou800 94u800 andu800 blast furnace slag 6u800 tou800 35u800 . sls1253 2003 foru800 portland limestone cement limestone cement portland limestone cement isu800 manufactured either byu800 intergrinding portland cement clinker with limestone oru800 byu800 blending finely ground limestone with opcu800. theu800 main constituents ofu800 portland limestone cement areu800 clinker 85u800 tou800 94u800 byu800 mass andu800 limestone 6u800 tou800 15u800 . theu800 calcium carbonate content ofu800 theu800 limestone should beu800 greater than 75u800 . specification parameters andu800 their effect onu800 cement quality theu800 specification parameters given inu800 theu800 twou800 standards iu800u82eeu800. sls1247 2003 andu800 sls1253 2003 their effect onu800 cement quality andu800 theu800 values specified inu800 theu800 twou800 standards areu800 given below compressive strength compressive strength atu800 theu800 ageu800 ofu800 3u800 days isu800 important with respect tou800 preu800-cast applications andu800 early removal ofu800 moulds formwork . compressive strength atu800 28u800 days isu800 important with respect tou800 safety economy andu800 durability ofu800 theu800 structure. both standards specify that compressive strength atu800 3u800 days should beu800 greater than 20mpa andu800 that atu800 28u800 days should beu800 betwe